[package]
name = "actix-web-lab"
rust_crate = "actix_web_lab"
rust_version = "0.24.3"
python_module = "spicycrab_actix_web_lab"

[cargo.dependencies]
actix-web-lab = "0.24.3"

[cargo.features]
available = ["cbor", "default", "derive", "msgpack", "spa"]
default = ["derive"]

# NOTE: Detected 2 macros without stubs: assert_response_matches, test_request
